def extract_unique_chars(s):
    """"""
    unique_chars = []
    for char in s:
        if s.count(char) == 1 and char not in unique_chars:
            unique_chars.append(char)
    unique_chars.sort()
    if unique_chars:
        return [unique_chars[0], unique_chars[-1]]
    else:
        return None
